import data from "../data";
const defaultImg = "https://placedog.net/200/200";

const contacts = (state = data.contacts, action) => {
  switch (action.type) {
    case "CREATE_PERSON": {
      return [
        ...state,
        {
          user_id: state.length,
          name: action.name,
          pic: defaultImg,
          status: action.status,
          details: action.details,
        },
      ];
    }
    default: {
      return state;
    }
  }
};

export default contacts;
